import { Tabs, Tab, Toolbar, Typography, Box,Button } from '@mui/material';
import AppBar from '@mui/material/AppBar';

export const Navbar = () => {



    return (
        <>
            <AppBar elevation={0}>
                <Toolbar disableGutters sx={{ p: 3, ml: 5 }} >
                    <Box
                        sx={{ display: 'flex', p: 1, bgcolor: 'background.paper', borderRadius: 1 }}
                    >
                         <Tab lable='Home'/>
                         <Button 
                         variant='contained'>sfa</Button>

                    </Box>
                </Toolbar>

            </AppBar>
        </>
    )
}
